import classes from "./Input.module.css";

const Input = (props) => {
  return (
    <div>
      <label>{props.label}</label>
      <input
        className={classes.input}
        id={props.id}
        type={props.type}
        min={props.min}
        max={props.max}
        step={props.step}
        value={props.defaultValue}
      ></input>
    </div>
  );
};

export default Input;
